(18416,	'2011-12-17',	19,	14,	'Cattle meat[beef] dropped by 200sh and 300sh and Goats meat dropped by 400sh and 500sh on whole sell and retail however traders blame this to high supply but low demand by consumers, Coffee arabica supply dropped thus the rise on price by 65sh and 180sh on whole sell and retail however traders attribute this to that farmers have decided not to sell off before x.mass that the traders are giving them low price, Beans agwede shotup by 100sh and 100sh, Beans nambale shotup by 50sh and 100sh on whole sell and retail due to low supply by traders from the supply source of mbale and kiboga while the demand by consumers was very high, Maize flour supply dropped thus the rise on price by 100sh and 100sh whole sell and retail respectively however traders blame this to low supply by traders due to power break down as the factories had not been able to produce maize flour, Millet flour and Millet grain supply dropped thus the rise on price by 250sh and 400sh on flour, 100sh and 300sh on grain however traders blame this high demand while the supply was very low and traders had nothing on there stalls, Rice super shotup by 200sh and 200sh on whole sell and retail due to that traders have started stocking for x.mass while due to high supply of simsim the price dropped by 300sh and 300sh on whole sell and retail respectively however traders blame this to high supply from soroti while traders had still with plenty on their stalls and stores.',	'Approved',	'2012-01-03',	30,	'2011-12-17 11:18:11',	19,	'2012-01-03 13:48:53',	30),
