(24083,	'2012-07-18',	19,	14,	'Cassava dry fermented shot up by 30sh and 50sh, cassava sun dried shot up by 50sh and 100sh on whole sell and retail respectively however traders blame this to low supply from the assembly markets of Busematia and Namutumba as it is the supply sources to Iganga market and traders had been without any in the market,Maize grain supply increased thus the drop on price by 50sh and 70sh on whole sell and retail respectively however traders blame this to that the old grains are costing more than the new ones mainly because the new ones have not dried well and maize flour is also expensive on the market since the new grain are not dry enough for flour,Irish potatoes supply increased thus the drop on price by 150sh and 100sh on whole sell and retail respectively however traders attribute this to high supply from the supply source of kisoro,kabale and traders had still stocked in plenty while the demand by consumers was also very low and traders had supplied in the market highly Apple banana supply increased in the market thus the drop on price by 100sh and 200sh while Cavendish bogoya also dropped by 200sh and 200sh on whole sell and retail respectively however traders attribute this to high supply from the supply source of mbale,mbarara and the surounding towns while the demand by consumers was very low..',	'Approved',	'2012-07-23',	30,	'2012-07-18 09:00:32',	19,	'2012-07-23 10:28:15',	30),
