(24441,	'2012-08-01',	19,	14,	'Dried beans agwede dropped by 150sh and 100sh on whole sell and retail respectively however traders blame this to high supply by traders from the assembly markets while the demand by consumers was very low and traders had still with plenty on there stock, As some farmers have started haversting, the price for g.nuts dropped by 200sh and 200sh on whole sell and retail respectively however traders blame to high supply from the supply source of soroti and mbale while the demand was very low and traders had in plenty,Maize flour dropped by 100sh and 100sh while Maize grain dropped by 150sh and 160sh on whole sell and retail respectively however traders attribute to high supply by traders from the assembly markets of Busembatia,Namutumba,Mayuge and Bukoli while demand by traders was very low as even some farmers have started also haversting and bringing to the town selling on bicycles,Rice kayiso supply increased thus the drop on price by 150sh and 100sh, Rice super dropped by 350sh and 200sh,Rice upland dropped by 100sh and 100sh however traders attribute this to high supply by traders from the supply sources and other traders had stocked plenty so they had to  drop the price and sell off the old stock so that they do not make more losses as it might drop more.',	'Approved',	'2012-08-03',	30,	'2012-08-01 10:55:02',	19,	'2012-08-03 11:42:18',	30),
