(28548,	'2012-12-29',	20,	3,	'The supply of both fish was very poor with Tilapia missing in stock, reason that the catch was poor due to weather and demand also remained low since most apple had not returned from up country.\r\n\r\nGrounduts frose up by 200/= w/s and 300/= retail as supply declined and demand increased after festival day. \r\nExotic eggs after xmas have gone up w/s 500 and retail respectively this has been attributed by low supply and during the festival much was taken to mostly S/sudan leaving local consumers with little to share.\r\nWhile local chicken record decline in prices for old stocks there\'s anticipation within next four hours to rise if the deamnd increases.\r\n\r\nThe Kayiso price has gone up by 100/= due to transportation charges went up and decline, but there was also little demand as a few traders had opened their stalls and also impact of the profailace  had not returned. ',	'Approved',	'2013-01-07',	30,	'2013-01-02 14:52:05',	20,	'2013-01-07 10:56:36',	30),
